import styled from 'styled-components';

export const ImageContainer = styled.div`
  border: 8px solid #303944;
  border-radius: 50%;
  padding: 25px;
  display: inline-block;
`;

export const Container = styled.div`
  display: inline-block;
`;

export const Title = styled.h1`
  color: #303944;
  text-align: center;
`;
